import Item from './Item';
import { Event } from '../models/event';

interface Props {
    events: Array<Event>;
    id: number;
    text: string;
    date: string;
    onDelete:(id: number) => any
}

const Events: React.FC<Props> = ({events, onDelete}) => {
    return (
        <>
        <h1>Event list: </h1>
        <ul>
        {events?.map((event, index) => (
            <Item 
                key={event.id}
                id={event.id}
                text={event.text}
                date={event.date} 
                events={[]}
                onDelete={onDelete}         
            />  
         ))}
        </ul>
        </>
    )
}


export default Events
